  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for National Elk
  Refuge outlines Refuge accomplishments from May through August of 1955. The report
  begins by summarizing the weather conditions, water conditions, food and cover,
  and wildfires during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, predators, raptors, fish, and disease- is also
  covered. The Refuge development and maintenance section discusses physical developments,
  plantings, and collections and receipts. The public relations section discusses
  recreational uses, Refuge visitors, Refuge participation, and fishing. Items of
  interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
